    false,nt"url": null,nt"notes": "The Pacific Islands Fisheries Science Center,
    part of the National Marine Fisheries Service, National Oceanic and Atmospheric
    Administration (NOAA), conducted cruises in the Northwest Hawaiian Islands and Guam
    on the R/V Hi'ialakai, Townsend Cromwell, and Oscar Elton Sette during 1999-2006.
    14 select cruises are included in this batch. Finalized data include the profiles
